import React from 'react'




const CollectionPreview = ({title,items }) => {
  return (
    <div>
      <h1>{title}</h1>
      <div className="preview">
        {
          items.map(item => {
            return(
              item.items.map(singleItem => (
                <div>
                  {singleItem.name}
                </div>
              ))
            )
          })
        }
      </div>
    </div>
  )
}

export default CollectionPreview;
